INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (40011, 24001, "クリア", 126001, 5, 325, 2, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 0, 1, 2);
